def generate_redis_addslots_commands(range_list, node_id):
    """
    Generate Redis `CLUSTER ADDSLOTS` commands for a given node ID.
    
    Parameters:
        range_list (str): Slot ranges, e.g., ": [0],[5],[10-12]..."
        node_id (str): Redis node ID (for context in commands).
        
    Returns:
        List[str]: Redis commands as strings.
    """
    import re
    
    # Parse ranges into a list of slots
    slots = []
    for part in range_list.split(','):
        if '-' in part:
            start, end = map(int, re.findall(r'\d+', part))
            slots.extend(range(start, end + 1))
        else:
            slots.append(int(re.findall(r'\d+', part)[0]))

    # Generate Redis commands
    commands = []
    batch_size = 100  # Redis has a limit; avoid overloading with too many slots in one command.
    for i in range(0, len(slots), batch_size):
        batch = slots[i:i + batch_size]
        commands.append(f"kubectl exec {node_id} -- redis-cli -c -h localhost -p 6379 CLUSTER ADDSLOTS {' '.join(map(str, batch))}")

    return commands

